/*Data for the table `taggable_taggables` */

/*Table structure for table `taggable_tags` */

DROP TABLE IF EXISTS `taggable_tags`;

CREATE TABLE `taggable_tags` (
  `tag_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `normalized` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`tag_id`),
  KEY `taggable_tags_normalized_index` (`normalized`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `taggable_tags` */

/*Table structure for table `tasks` */

DROP TABLE IF EXISTS `tasks`;

CREATE TABLE `tasks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `finished` tinyint(4) NOT NULL DEFAULT '0',
  `task_description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `task_deadline` date NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `tasks` */

/*Table structure for table `tb_competition` */

DROP TABLE IF EXISTS `tb_competition`;

CREATE TABLE `tb_competition` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '',
  `slug` varchar(1024) NOT NULL DEFAULT '',
  `small_description` text,
  `full_description` text,
  `main_image` varchar(1024) NOT NULL DEFAULT '',
  `normal_price` varchar(100) NOT NULL DEFAULT '' COMMENT 'del price',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'Ticket price',
  `total_num` int(10) NOT NULL DEFAULT '0' COMMENT 'Number of tickets',
  `deadline_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `auto_extend` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1-checked',
  `hours_extend` varchar(50) DEFAULT '' COMMENT 'Number of hours to extend :auto_extend-1',
  `max_per_user` int(10) NOT NULL DEFAULT '1' COMMENT 'Max ticket per user',
  `question` text,
  `count_per_tab` int(10) NOT NULL DEFAULT '10' COMMENT 'Sort tickets in number of tabs',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '-1-force stop  0-create,1-doing,2-complete',
  `draw_video_url` text COMMENT 'Draw Video Link',
  `delivery_video_ur1` text,
  `winner_user_name` varchar(1024) NOT NULL DEFAULT '',
  `ticket_number` varchar(1024) NOT NULL DEFAULT '',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `competiotion_title` varchar(1024) NOT NULL DEFAULT '',
