/*Table structure for table `tb_order` */

DROP TABLE IF EXISTS `tb_order`;

CREATE TABLE `tb_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT 'users:id',
  `order_number` varchar(50) NOT NULL DEFAULT '' COMMENT 'order number',
  `total_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'order price',
  `user_name` varchar(50) NOT NULL DEFAULT '' COMMENT 'order personal name',
  `first_name` varchar(50) NOT NULL DEFAULT '',
  `last_name` varchar(50) NOT NULL DEFAULT '',
  `address` varchar(50) NOT NULL DEFAULT '' COMMENT 'order personal address',
  `address1` varchar(50) NOT NULL DEFAULT '',
  `address2` varchar(50) NOT NULL DEFAULT '',
  `city` varchar(100) NOT NULL DEFAULT '',
  `postcode` varchar(100) NOT NULL DEFAULT '',
  `country` varchar(100) NOT NULL DEFAULT '',
  `county` varchar(100) NOT NULL DEFAULT '',
  `phone` varchar(50) NOT NULL DEFAULT '',
  `order_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0-created,1-pay competed',
  `trans_code` varchar(100) NOT NULL DEFAULT '' COMMENT 'pay transaction code',
  `trans_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'pay time',
  `promo_code_id` int(10) NOT NULL DEFAULT '0' COMMENT 'tb_promo_code',
  `diff_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'coupon off price',
  `real_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'real price',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

