/* Event structure for event `removeTicketsEvent` */

/*!50106 DROP EVENT IF EXISTS `removeTicketsEvent`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `removeTicketsEvent` ON SCHEDULE EVERY 1 MINUTE STARTS '2016-07-23 00:00:00' ON COMPLETION PRESERVE ENABLE DO BEGIN
   -- schedule test code
   INSERT INTO test set title ='111';
   
   -- remove the ticket  selected status
   /* UPDATE tb_competition_ticket a SET a.status = 0, a.seleted_time = '0000-00-00 00:00:00', selected_user_id = 0 
	WHERE id IN (SELECT ticket_id FROM tb_user_basket WHERE DATE_ADD(create_date,INTERVAL 5 MINUTE) < NOW());
   DELETE FROM tb_user_basket WHERE DATE_ADD(create_date,INTERVAL 5 MINUTE) < NOW(); */
   
   
   END */$$
DELIMITER ;

/* Function  structure for function  `getCompetitionRemainCount` */

/*!50003 DROP FUNCTION IF EXISTS `getCompetitionRemainCount` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getCompetitionRemainCount`(_id int(10)) RETURNS int(10)
BEGIN
	declare _cnt int(10);
	DECLARE _cnt1 INT(10);
	select count(*) from tb_competition_ticket a  where a.competition_id = _id  and a.status = 2 into _cnt;
	SELECT total_num FROM tb_competition where id = _id into _cnt1;
	if _cnt1 is null then return 0; end IF ;
	set _cnt = _cnt1-_cnt;
	return _cnt;
    END */$$
DELIMITER ;

